import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';

class YahooAPI extends Component {
    render() {
        return(
            <div>
                <div className="api-">{this.props.symbolProp}</div>
                <div className="api-">{this.props.regularMarketPriceProp}</div>
                <div className="api-">{this.props.sharesOutstandingProp}</div>
            </div>
        )

    }


}
